import '../css/Card.css';

export default function Category() {
  return (
    <div class="container">
        <div class="card" style="--cards: 5">
            <div class="child">
                <h2>Why do I need a will</h2>
                <p>5 articles</p>
            </div>
        <div class="child"></div>
        <div class="child"></div>
        <div class="child"></div>
        <div class="child"></div>
        </div>
    </div>
  );
}
